[[File:Gilbert De Bruneteau (1760-1830).jpg|thumb|Gilbert De Bruneteau.]] '''Gilles-Joseph-Martin Bruneteau Saint-Suzanne''' (7 March 1760 &ndash; 26 August 1830) was a [[French Revolution]]ary and Napoleonic general. A Grand Officer of the [[Legion of Honour]], he was made a Count under the [[First French Empire]]. His [[Names inscribed under the Arc de Triomphe|name is inscribed "S<sup>{{SC|te}}</sup> SUZANNE"]] on the east pillar of the [[Arc de Triomphe]].<ref>{{harvnb|Jensen|2013}} cites {{harvnb|Six|2003}}</ref>
